import React, { useEffect, useState } from 'react';
import axios from 'axios';
import ShowMenuItem from './ShowMenuItem';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'

export default function ShowMenu(props) {
    const [menu, setMenu] = useState([]);
    useEffect(() => {
        axios.get('http://localhost:3000/api/menu', { params: { restaurant: props.restaurant } }).then(res => {
            console.log(res.data);
            setMenu(res.data);
        });
    }, []);

    return (
        <BrowserRouter>
            <div>
            {
                menu.map((m, key) =>
                    <Link key={key} to="/showMenuItem">{m.name}</Link>
                )
            }
            </div>
            <Routes>
                <Route path={"/showMenuItem"} element={<ShowMenuItem menuItem={1} />} />
            </Routes>
        </BrowserRouter>)
}
